import React from 'react';

const h = React.createElement;

    export default class ProgressBar extends React.Component {
        constructor (props) {
          super();
          this.steps = ["0","1","2","3","4"];
          this.step=props.step;
          this.state = {};
        }
        render() {
          return h("", {className:"ProgressBar"},
          this.RenderProgress()
          );
        }

        RenderProgress(){
            let progress = [];
            this.steps.forEach(val => {
                if (val === this.step){progress.push("currentstep")}
                else {progress.push("notcurrentstep")}
            })
            return progress.map((intication) => <div className={intication}></div>)
      }
    }
